import React from 'react'
import Table from "./Table";

const data = [
    { reportID: 1, serviceName: "HTTP", connectionDuration: "1:25", attackerIP: "10.0.2.100", trapName: "Admin", sessionINFO: "hello world" },
    { reportID: 2, serviceName: "FTP", connectionDuration: "1:25", attackerIP: "10.0.2.100", trapName: "Admin", sessionINFO: "hello world" },
    { reportID: 3, serviceName: "SSH", connectionDuration: "1:25", attackerIP: "10.0.2.4", trapName: "Admin", sessionINFO: "hello world" },
    { reportID: 4, serviceName: "SMTP", connectionDuration: "1:25", attackerIP: "10.0.2.2", trapName: "Admin", sessionINFO: "hello world" },
];

function Home() {



    return (
        <div id="reports">
            <h2>Report</h2>
            <br/>
            <Table data={data}></Table>
        </div>
    );
}

export default Home;
